import { Footer } from "../../components/layout/Footer";
import { Navbar } from "../../components/layout/Navbar";
import { useState, useEffect } from "react";

export const Dashboard = () => {
  const [currentIndex, setCurrentIndex] = useState(0);

  const slides = [
    {
      image: {
        url: "https://img.freepik.com/premium-photo/indian-housewife-showcasing-her-culinary-skills-as-she-cooks-traditional-dishes-exemplifying-her-rich-cultural-heritage_984126-12937.jpg?w=740",
        alt: "Indian housewife cooking"
      },
      title: "Come, taste a new kind of Home.",
      description: "Meals from a professionally managed kitchen, made with a mother's touch."
    },
    {
      image: {
        url: "https://th.bing.com/th/id/OIP.MTSY1wtCXcJ8dQvEY7NRQAHaE8?w=275&h=184&c=7&r=0&o=5&dpr=1.3&pid=1.7",
        alt: "Happy family eating together"
      },
      title: "Family-style meals delivered",
      description: "Enjoy the warmth of shared meals, even when you're dining alone."
    },
    {
      image: {
        url: "data:image/jpeg;base64,",
        alt: "Traditional Indian thali"
      },
      title: "Authentic flavors every day",
      description: "Traditional recipes prepared with care and the finest ingredients."
    },
    {
      image: {
        url: "https://th.bing.com/th/id/OIP.dIZjDFt_5Kpfi1BHZcZIwAHaEK?w=287&h=180&c=7&r=0&o=5&dpr=1.3&pid=1.7",
        alt: "Chef cooking in kitchen"
      },
      title: "Professional quality, homemade taste",
      description: "Our chefs combine professional expertise with homestyle cooking techniques."
    }
  ];

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentIndex((prevIndex) => 
        prevIndex === slides.length - 1 ? 0 : prevIndex + 1
      );
    }, 5000); // Change slide every 5 seconds

    return () => clearInterval(interval);
  }, [slides.length]);
  // @ts-ignore
  const goToSlide = (index) => {
    setCurrentIndex(index);
  };

  const goToPrevSlide = () => {
    setCurrentIndex((prevIndex) => 
      prevIndex === 0 ? slides.length - 1 : prevIndex - 1
    );
  };

  const goToNextSlide = () => {
    setCurrentIndex((prevIndex) => 
      prevIndex === slides.length - 1 ? 0 : prevIndex + 1
    );
  };

  return (
    <div className="min-h-screen flex flex-col bg-[#f8f9f0] text-black">
      {/* Navbar */}
      <Navbar />

      {/* Main content */}
      <div className="flex-grow container mx-auto px-4 py-8 text-center">
        <h1 className="text-4xl font-bold leading-relaxed">
          Eat better with Aai's Kitchen
        </h1>
        <h6 className="text-sm text-gray-600 font-medium leading-relaxed mb-6">
          Trusted by students and professionals,<br />
          delivering homely, healthy meals — simply and reliably.
        </h6>

        {/* Carousel Section */}
        <div className="flex flex-col md:flex-row items-center transition-opacity duration-500 ease-in ease-out  justify-between gap-8 px-6 py-12 bg-[#f8f9f0] relative">
          {/* Text Section - Now part of the carousel */}
          <div className="w-full md:w-1/2 text-left space-y-4 transition-opacity   duration-500">
            <h1 className="text-4xl md:text-5xl font-bold text-[#154313] leading-tight">
              {slides[currentIndex].title.split('\n').map((line, i) => (
                <span key={i}>
                  {line}
                  <br />
                </span>
              ))}
            </h1>
            <p className="text-lg md:text-xl text-gray-700 font-medium">
              {slides[currentIndex].description}
            </p>
          </div>

          {/* Image Section - Now part of the carousel */}
          <div className="w-full md:w-2/3">
            <div className="relative overflow-hidden rounded-xl shadow-lg">
              <img
                src={slides[currentIndex].image.url}
                alt={slides[currentIndex].image.alt}
                className="w-full h-96 object-cover transition-opacity duration-500"
              />
            </div>
          </div>

          {/* Navigation controls */}
          <div className="absolute bottom-4 left-0 right-0 flex justify-center gap-2">
            {slides.map((_, index) => (
              <button
                key={index}
                onClick={() => goToSlide(index)}
                className={`w-3 h-3 rounded-full cursor-pointer ${currentIndex === index ? 'bg-[#154313]' : 'bg-gray-400'}`}
                aria-label={`Go to slide ${index + 1}`}
              />
            ))}
          </div>
          
          <button 
            onClick={goToPrevSlide}
            className="absolute left-0 top-1/2 -translate-y-1/2 bg-white/80 p-2 rounded-full shadow-md hover:bg-white z-10"
            aria-label="Previous slide"
          >
            <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 cursor-pointer" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 19l-7-7 7-7" />
            </svg>
          </button>
          <button 
            onClick={goToNextSlide}
            className="absolute right-0 top-1/2 -translate-y-1/2  bg-white/80 p-2 rounded-full shadow-md hover:bg-white z-10"
            aria-label="Next slide"
          >
            <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 cursor-pointer" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
            </svg>
          </button>
        </div>
      </div>

      {/* Footer */}
      <Footer />
    </div>
  );
};